bio:
I have a B.Sc. in Computer Science from Ben Gurion University and i've been a software developer for the past 3 years.
Coding is part of my life; I volunteer as an instructor at SheCodes for Python & Data Analaysis tracks;
contribute to open source projects and also develop some of my own; take online courses on different CS related subjects;  etc.

I work as data/BI lead and recently as a product manager at my6sense; 
I volunteer as a board member at "Midaat - for informed health" promoting informed decision making about public health (vaccines good, ignorance bad). 
I hold an M.Sc in computational biology, and I also sing with the Troubadours, songs of science and science fiction.
